import Card from "./context";

function Home() {
  return (
    <Card
      bgcolor="secondary"
      txtcolor="white"
      header="BadBank Home"
      title="Welcome To The Bad Bank"
      text="Don't To Triple Check Your Transaction!"
      body={(
        <div>
      <img src="./badbankimage.jpg" className="img-fluid" alt="Responsive image"/>
      <br/>
      <button type="button" className="btn btn-light button-spacing">
        <Link className="nav-link" to="/login/">
            Login
        </Link>
      </button>
      </div>
      )}
    />    
  ); 
}

export default Home;
